import React from 'react';



// PersonalInfo Component
const PersonalInfo = (props) => {
  return (
    <div>
      <p>Name: {props.name}</p>
      <p>Age: {props.age}</p>
      <p>Occupation: {props.occupation}</p>
    </div>
  );
};




function App() {
  const personalInfo = {
    name: "John Doe",
    age: 30,
    occupation: "Software Developer"
  };

  return (
    <div>
      <h1>Personal Information</h1>
      <PersonalInfo name="Jane Doe" age={28} occupation="Designer" />

      <h1>Summary Information</h1>
      <Summary personalInfo={personalInfo} />
    </div>
  );
}

export default App;
